    "2016-07-27T22:21:11.984033",nt"name": "wildlife-inventory-plan-1985",nt"isopen":
    false,nt"url": null,nt"notes": "Ruby Lake National Wildlife Refuge was
    established in 1938 as a refuge and breeding ground for migratory birds and other
    wildlife. While the refuge represents important habitat for a wide diversity of
    wildlife species, a set of management objectives has been developed for some which
    are important nationally or are rare or declining in numbers, Management efforts
    including time and dollar expenditures for inventorying important species are geared
    towards meeting refuge objectives. Objectives for Ruby Lake have been prioritized
    into 3 categories and include the following: Highest Priority Objectives, High Priority
    Objectives, Moderate Priority Objectives. A station inventory plan for Ruby Lake
    was initially developed in 1973, then revised in 1982. This final revision represents
    both a prioritization of inventory efforts based on refuge objectives and an attempt
    to standardize wildlife inventory procedures in Region I. Individual procedures
    for bird and mammal species are outlined in this document.",nt"license_title":
